import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class App extends React.Component {
  render() {
    return (
      <div>
        <ul>
          <li>
            Test
          </li>
          <li>
            Test
          </li>
          <li>
            Test
          </li>
        </ul>
        <ul>
        <li>
          Test
        </li>
        <li>
          Test
        </li>
        <li>
          Test
        </li>
      </ul>
    </div>
    );
  }
}

// ========================================

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
